import React from "react";
import { Link, useNavigate } from "react-router-dom";
import { useAuth } from "../context/AuthContext";

const Navbar = () => {
  const { user, logout } = useAuth();
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <nav className="bg-blue-600 text-white px-6 py-3 flex justify-between items-center">
      <div className="text-xl font-bold">Meal Planner</div>
      {user && (
        <div className="flex gap-4 items-center">
          <Link to="/" className="hover:underline">Tạo thực đơn</Link>
          <Link to="/calorie" className="hover:underline">Ước lượng calo</Link>
          <Link to="/workout" className="hover:underline">Kế hoạch tập</Link>
          <button onClick={handleLogout} className="bg-red-500 px-3 py-1 rounded hover:bg-red-600">Đăng xuất</button>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
